import React from 'react';
import '../css/Main.css';
import RandomButton from '../components/RandomButton';
import Stratigic from '../components/Strategic';
import Proficient from '../components/Proficient';
import Advanced from '../components/Advanced';

export default () => {

    return(
        <div className='container'>
            <div className='col-sm-12 text-center mt-2'>
                <h1 className='title'> The Differentiator </h1>
            </div>
            <RandomButton />
            <Stratigic className="strategic" />
            <Proficient className="proficient" />
            <Advanced className="strategic" />
        </div>
    )

}
